import Routes from './routes' // Depois de importar as rotas, você é capaz de importar como uma tag

function App() { //Componentes sao definidos por classe ou função 
  return (
    <BrowserRouter>
    <Header />
    <Routes />
    </BrowserRouter>
  );
}

export default App;
